function startCase(string) {
  // Handle null/undefined input
  if (!string) return '';

  return string
    // Convert camelCase to spaces
    .replace(/([a-z])([A-Z])/g, '$1 $2')
    // Replace special characters with spaces
    .replace(/[_.-]/g, ' ')
    // Remove extra spaces
    .replace(/\s+/g, ' ')
    .trim()
    // Split into words, capitalize first letter of each, then join
    .split(' ')
    .map(word => word.charAt(0).toUpperCase() + word.slice(1).toLowerCase())
    .join(' ');
}

function transformObject(input) {
  return {
    ...input.columns,
    changeType: startCase(input.columns.changeType),
    changes: Object.values(input.columns.changes).map((change) => ({
      ...change,
      fieldName: startCase(change.fieldName.substring(1)),
    })),
  };
}

